 Magic Video Converter 
=======================================================================

Convert videos, split video, merge videos and burn DVD. MVC meets all your needs for DVD CD/SVCD burning and video format converting. It can convert and split a wide range of formats such as AVI, MPEG, MPEG 1, MPEG 2, MPEG 4, VCD, DVD, SVCD, RMVB, RM, WMV, MOV, DIVX, etc... And the converted files can be played on your iPod, iPhone, Apple TV, Google Android, Mobile MP4, PS3, PSP and Sony WalkMan.

A new function of MVC is a &quot;preview window&quot;. This function is fit for users who want to view video directly after finishing converting. A &quot;still split video&quot; function has been added where users can split videos by previewing the video.
